      "\n",
      "# Trying polynomial fitting treatment\n",
      "x = data.loc[np.logical_not(data[\"LotFrontage\"].isnull()), \"LotArea\"]\n",
      "y = data.loc[np.logical_not(data[\"LotFrontage\"].isnull()), \"LotFrontage\"]\n",
      "\n",
      "plt.scatter(x, y)\n",
      "\n",
      "t = (x <= 25000) & (y <= 150)\n",
      "p = np.polyfit(x[t], y[t], 1)\n",
      "data.loc[data.LotFrontage.isnull(), 'LotFrontage'] = \\\n",
      "np.polyval(p, data.loc[data['LotFrontage'].isnull(), 'LotArea'])"
